  true,\n\t\"url\": null,\n\t\"notes\": \"Photochemical Assessment Monitoring Stations
  (PAMS). This file provides information on the numbers and distribution (latitude/longitude)
  of air monitoring sites  which measure ozone precursors (approximately 60 volatile
  hydrocarbons and carbonyl), as required by the 1990 Clean Air Act Amendments, in
  areas with persistently high ozone levels (mostly large metropolitan areas).  In
  these areas, the States have established ambient air monitoring sites which collect
  and report detailed data for volatile organic compounds, nitrogen oxides, ozone
  and meteorological parameters.  This file displays 199 monitoring sites reporting
  measurements for 2010.  A wide range of related monitoring site attributes is also
  provided.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\": [{\n\t\t\"key\":
